import React from 'react'
import './App.css'
import { Container } from 'react-bootstrap/Container'
import { Row } from 'react-bootstrap/Row'
import { Button } from 'react-bootstrap/Button'



class App extends React.Component {
  state = {
    users: [
      {
        id: 1,
        username: "blake",
        profileImage: "http://next-curriculum-instagram.s3.amazonaws.com/idol2-blake.jpg"
      },
      {
        id: 2,
        username: "ryanG",
        profileImage: "http://next-curriculum-instagram.s3.amazonaws.com/idol1-ryan.jpg"
      },
      {
        id: 3,
        username: "bigfan",
        profileImage: "http://next-curriculum-instagram.s3.amazonaws.com/bigfan-9AE7468E-4C35-41D1-AA68-31939891B5E1.png"
      }
    ]
  }

  render(){
    return (
      <Container>
        <Row className="p-4">
        <h1>Home Page</h1>
        <div>
          <Button>Hello</Button>
        </div>
        <ul>
          {
            this.state.users.map(user =>
                <li>
                    {user.id}: {user.username} <br />
                    <img src={user.profileImage} className="rounded-circle" />
                </li>
            )
          }
        </ul>
        </Row>
      </Container>
    )
  }
}

export default App;
